import sys

my_input = ''


class Day5:
    @staticmethod
    def _find_ngrams(input_list, n):
        return zip(*(input_list[i:] for i in range(n)))

    @staticmethod
    def _annihilate(polymer_string):
        for twogram in Day5._find_ngrams(polymer_string, 2):
            twogram = ''.join(twogram)
            if twogram[0].lower() == twogram[1].lower() and twogram[0] != twogram[1]:
                polymer_string = polymer_string.replace(twogram, '', 1)
                break

        return polymer_string

    @staticmethod
    def first(polymer_string):
        while True:
            annihilate_result = Day5._annihilate(polymer_string)
            polymer_string = Day5._annihilate(annihilate_result)
            if polymer_string == annihilate_result:
                break

        return len(polymer_string)

    @staticmethod
    def _recursive_replace(next_str):
        print(len(next_str))
        to_delete = ['aA', 'Aa', 'bB', 'Bb', 'cC', 'Cc', 'dD', 'Dd']
        for each in to_delete:
            if each in next_str:
                return Day5._recursive_replace(next_str.replace(each, '', 1))

        return next_str

    @staticmethod
    def second(polymer_string):
        sys.setrecursionlimit(10000)
        letters_to_replace = 'abcd'
        shortest = float('inf')
        for letter in letters_to_replace:
            current_polymer_string = polymer_string.replace(letter.upper(), '').replace(letter, '')
            result = Day5._recursive_replace(current_polymer_string)
            if len(result) < shortest:
                shortest = len(result)

        return shortest


print(Day5.second(my_input))
